script: |
  super -f text -I q4233.spq | sort > q4233.out

inputs:
  - name: q4233.spq
    data: |
      SELECT DISTINCT + col0 - - col0 * - 47 AS col2 FROM tab1 (FORMAT parquet) WHERE ( NOT col1 / col1 - 48 IN ( - col2 * + col2 ) );
  - name: tab1

outputs:
  - name: q4233.out
    data: |
      -2346
      -3910
      -4186
